    function yposition(d, i) {
        if (i >= 0 && i < 16) {
            return 80;
        } if (i > 15 && i < 32) {
            return 255;
        } if (i > 31 && i < 48) {
            return 430;
        }
        if (i > 47 && i < 64) {
            return 605;
        }
        else {
            return 750;
        }
    }
    function xposition(d, i) {
        if (i >= 0 && i < 16) {
            return 132 * 1.14 * i + 7;
        } if (i > 15 && i < 32) {
            return 132 * 1.14 * i - 2399.5;
        }
        if (i > 31 && i < 48) {
            return 132 * 1.14 * i - 4807;
        } if (i > 47 && i < 64) {
            return 132 * 1.14 * i - 7215;
        }
    }
    function groupposition(d, i) {
        let x = xposition(d, i);
        let y = yposition(d, i);
        return "translate(" + x + "," + y + ")";
    }

